import React from 'react';
import './UltimasVagas.css';

function UltimasVagas() {
  return (
    <div className='ultimasvagas'>
        <div className='ultimasvagas-container'>
            <div className='ultimasvagas-fileira-1'>
                    <div className='ultimasvagas-bloco-1'>
                        <p className='ultimasvagas-bloco-titulo'>Estágio</p>
                        <p className='ultimasvagas-bloco-conteudo'>Área: Dispositivos Embarcados<br />Empresa: Nome Empresa<br />Local: Patos de Minas/MG</p>
                    </div>
                    <div className='ultimasvagas-bloco-1'></div>
                    <div className='ultimasvagas-bloco-1'></div>
                    <div className='ultimasvagas-bloco-1'></div>
            </div>

            <div className='ultimasvagas-fileira-2'>

            </div>

            <div className='ultimasvagas-fileira-3'>

            </div>

            <div className='ultimasvagas-fileira-4'>

            </div>

        </div>
    </div>
    );
}

export default UltimasVagas;
